import React from "react"
import TextField from '@mui/material/TextField';

export const Email = () => {
  const [email, setEmail] = useState('')

  return (
    <TextField
      autoFocus
      margin="dense"
      id="email"
      label="E-mail"
      type="email"
      required
      value={email}
      onChange={e => setEmail(e.target.value)}
      fullWidth variant="standard"
    />
  );
}
